const FileData = (props) =>{
    let itemFile = props.file;
    let updatedFile = []
    for (const record in itemFile){
        console.log(record)
        if (updatedFile.record['name']){
            updatedFile.record[0].batch.push(record[1])
        }
    }
};

export default FileData;
